var customCode = `
<style>
/* The Modal (background) */
.modal {
    display: none; /* Hidden by default */
    position: fixed; /* Stay in place */
    z-index: 1; /* Sit on top */
    padding-top: 100px; /* Location of the box */
    left: 0;
    top: 0;
    width: 100%; /* Full width */
    height: 100%; /* Full height */
    overflow: auto; /* Enable scroll if needed */
    background-color: rgb(0,0,0); /* Fallback color */
    background-color: rgba(0,0,0,0.4); /* Black w/ opacity */
}

/* Modal Content */
.modal-content {
    background-color: #fefefe;
    margin: auto;
    padding: 20px;
    border: 1px solid #888;
    width: 1080px;
}

/* The Close Button */
.my-close {
    color: #aaaaaa;
    float: right;
    font-size: 28px;
    font-weight: bold;
}

.my-close:hover,
.my-close:focus {
    color: #000;
    text-decoration: none;
    cursor: pointer;
}

.m-preview {
	display: table;
	width: 512px;
	height: 512px;
	float: left;
	
	font-family: "Open Sans", "Lucida Grande", "Lucida Sans Unicode", Arial, Helvetica, Verdana, sans-serif;
	line-height: normal;
	
	background: white;
	background: black;
	background: transparent;
	background: url('data:image/bmp;base64,');
}
.m-user-message {
	background-color: white;
	border-radius: 15px;
				
	right: 0;
	/*box-shadow: 0 3px 2px -2px grey;*/
	border: 2px solid rgb(249, 244, 244);
}
.m-user-ava {
	vertical-align: bottom;
	bottom: 0;
	position: absolute;
}
.m-user-ava img {
	width: 100%;
	border-radius: 50%;
}
.m-user-ava > span {
	width: 100%;
	height: 100%;
	
}
.m-user-message-text {
	margin: 2px auto;
}
.m-cloud-gray {
	position: absolute;
	bottom: 0px;
}
.m-cloud-white {
	position: absolute;
}
.m-cloud-gray .m-cloud-inr {
	border-bottom: 0px solid rgb(249, 244, 244);
	border-left: 0px solid transparent;
}
.m-cloud-white .m-cloud-inr {
	border-bottom: 0px solid white;
	border-left: 0px solid transparent;
}
.m-message {
	margin: 0 auto;
	vertical-align: bottom;
	position: relative;
}
.m-messages {
	display: table-cell;
	vertical-align: middle;
}
.m-messages-separator {
	height: 15px;
}

#result-png {
	cursor: pointer;
}

body.m-demo .m-user-name {
	color: #539e4f;
	font-weight: bold;
}
</style>
`;

var formHtml = `
	<input type="range" min="9" max="30" style="width:512px" id="m-preview-size" value="11">

	<table>
		<thead>
			<tr>
				<td><strong>Preview (CSS)</strong></td>
				<td><strong>Result (PNG)</strong></td>
			</tr>
		</thead>
		<tbody>
			<tr>
				<td>
					<div id="preview" class="m-preview">
						<div class="m-messages">
							
						</div>
					</div>
				</td>
				<td>
					<div id="result-png" title="download"></div>		
				</td>
			</tr>
		</tbody>
	</table>`;

var modalHtml = `
	<div id="tmp-wrap"></div>
	<div id="myModal" class="modal">
	  <div class="modal-content">
			<span class="my-close">&times;</span>
			
			<div id="myControls">
				${formHtml}
			</div>
	  </div>
	</div>
`;

if (typeof window.demoMessages !== 'undefined') {
	demoMain(demoMessages);
} else {
	main(window);
}

var StickerEditor = {
	createMessage: function (msg) {
		return `<div class="m-message">
					<div class="m-user-ava">
						` + (msg.avatar ? `<img src="${msg.avatar}">` : msg.avatarHtml) + `
					</div>
					<div class="m-user-message">																	
						<span contentEditable class="m-user-name ${msg.authorClass}">${msg.author}</span>
						<p contentEditable class="m-user-message-text">${msg.text}</p>
						
						<div class="m-cloud-gray"><div class="m-cloud-inr"></div></div>
						<div class="m-cloud-white"><div class="m-cloud-inr"></div></div>
					</div>
				</div>`;
	}
};

function renderMessages(selectedMessages) {
	$('.m-messages').html(selectedMessages.map(StickerEditor.createMessage).join('<div class="m-messages-separator"></div>'));
	$('#m-preview-size').val(12);
	previewResize();
}

function main(window) {
	window.onload = function () {
		$('body').append(customCode + modalHtml);
		var modal = document.getElementById('myModal');
		
		$('body').on('click', '.m-open-modal', function () {
			var selectedMessages = [];
			
			async.each($('.im_message_selected').toArray(), function (el, cb) {
				var $wrap = $(el).find('.im_content_message_wrap');
				var $img = $wrap.find('.im_message_from_photo .im_message_from_photo');
				
				var author = $wrap.find('.im_message_author').text();
				var authorClass = $wrap.find('.im_message_author').attr('class');			
				var text = $wrap.find('.im_message_text').html();
				
				var cusMsg = {
					authorClass: authorClass,
					author: author,
					text: text
				}
				
				if ($img.is('img')) {
					downloadImage($img.attr('src'), function (error, arr) {
						var base64 = fromArray(arr);
						cusMsg.avatar = base64;
						
						selectedMessages.push(cusMsg);
						cb();
					});
				} else {
					cusMsg.avatarHtml = $img[0].outerHTML;
					selectedMessages.push(cusMsg);
					cb();
				}
			}, function () {
				renderMessages(selectedMessages);
				modal.style.display = "block";
			});
		});
		
		$('body').on('click', '.my-close', function () {
			modal.style.display = "none";
		});

		window.onclick = function(event) {
			if (event.target == modal) {
				modal.style.display = "none";
			}
		}
		
		setInterval(function () {
			var $selectedMsg = $('.im_message_selected');
					
			if ($('.im_edit_selected_actions .m-open-modal').length === 0) {
				$('.im_edit_selected_actions').append('<a class="m-open-modal btn btn-primary im_edit_delete_btn">Create sticker</a>');
			}
			
			$('.m-open-modal').css('display', $selectedMsg.length > 0 ? 'inline' : 'none');
		}, 200);
		
		$('#m-preview-size').on('input', previewResize);
		startObserver();
	};
}

function demoMain(messages) {
	window.onload = function () {
		$('body').append(customCode + formHtml + '<div id="tmp-wrap"></div>');
		
		renderMessages(messages);
		
		$('#m-preview-size').on('input', previewResize);
		startObserver();
	};
}

function downloadImage(url, callback) {
    var xhr = new window.XMLHttpRequest();

    xhr.withCredentials = true;
    xhr.open("GET", url, true);
    xhr.responseType = "arraybuffer";
    xhr.onload = function () {
        if (xhr.readyState !== 4 || xhr.status !== 200) {
            console.error('image download error');
        } else {
            var array = xhr.response ? new Uint8Array(xhr.response) : new Uint8Array("");
            callback(null, array);
        }
    };
    xhr.onerror = function () {
		debugger;
		console.log('err');
	};
    xhr.send();
}

function fromArray(array) {
    var arrayString = arrayToString(array);
    var bytes = btoa(arrayString);
    return fromBase64(bytes);
};

function arrayToString(array) {
    var str = "";
    for (var i = 0; i < array.length; i += 65536) {
        str += String.fromCharCode.apply(String, array.subarray(i, Math.min(i + 65536, array.length)));
    }
    return str;
}

function fromBase64(base64) {
    var format = "image/gif";
    if (base64.indexOf("/9j/") === 0) {
        format = "image/jpeg";
    } else if (base64.indexOf("iVBO") === 0) {
        format = "image/png";
    } else if (base64.indexOf("PD94") === 0) {
        format = "image/svg+xml";
    }
    return "data:" + format + ";base64," + base64;
}


function startObserver() {
	var inProcess = false,
		needDraw = true;

	var observer = new MutationObserver(function(mutations) {
		needDraw = true;
		reDraw();
	});
	
	var config = { attributes: true, childList: true, characterData: true, subtree: true };

	function reDraw () {
		if (inProcess || !needDraw) {
			return;
		}
	
		inProcess = true;
		needDraw = false;
		
		$('#preview-copy').remove();
		var clone = $('#preview').clone()
			.attr('id', 'preview-copy')
			.css('background', 'transparent');
		
		$('#tmp-wrap')
			.css('position', 'absolute')
			.css('bottom', '-1000px');
			
		$('#tmp-wrap').append(clone);
		
		html2canvas(document.getElementById('preview-copy'), {
			onrendered: function(canvas) {
				$('#result-png').html('').append(canvas);
		
				$('#preview-copy').remove();		
				inProcess = false;
				reDraw();
			}
		});
		observer.observe($('#preview')[0], config);
	}; 
	
	$('body').on('click', '#result-png', function () {
		var link = document.createElement('a');
		link.href = $('#result-png canvas')[0].toDataURL();
		link.download = 'sticker.png';
		link.click();
	});
	
	previewResize();
	reDraw();
}

function previewResize() {
	var val = parseInt(document.getElementById('m-preview-size').value) / 100 * 512;
	
	$('.m-user-ava')
		.css('width', val)
		.css('line-height', val + 'px');
	
	var d = 15,
		marginLeft = val + d,
		padding = val / 3,
		border = 2,
		cloudWidth = 20,
		width = 512 - marginLeft - 2 * border;
	if ($('body').is('.m-demo')) {
		width -= 2 * padding; // WTF??
	}
	$('.m-user-message').css('width', width);
	$('.m-user-message').css('margin-left', marginLeft + 'px');
	$('.m-user-message').css('padding', padding + 'px');
	$('#preview').css('font-size', val / 3.1 + 'px');
	
	$('.m-cloud-gray').css('left', marginLeft - cloudWidth + border);
	$('.m-cloud-white').css('left', marginLeft - cloudWidth + 2*border + 2).css('bottom', border + 'px');
	
	$('.m-cloud-gray, .m-cloud-white').find('*')
		.css('border-bottom-width', cloudWidth)
		.css('border-left-width', cloudWidth)
		.css('width', 2 * cloudWidth);
}


